ou dear Have a nice day.";i:55;s:65:"Question 16 Consider the following tetra-substituted cyclohexane.";i:56;s:52:"OH Select both chair conformations of this compound.";i:57;s:73:"Et OH OH OH EE OH Et hooojpg Determine which conformation is more stable.";i:58;s:150:"ОН Et ОН Et ОН Et Et -ОН At equilibrium would you expect the compound to spend more than 95 of its time in the more stable chair conformation.";i:59;s:231:"In a five-membered ring a C01258 in which two adjacent atoms are maximally displaced in opposite directions relative to the plane containing the other three carbon atoms has been called a H02715 but is better called a twist C01258.";i:60;s:111:"Draw the two chair conformation for trans 14-dibromocyclohexane and indicate which conformation is more stable.";i:61;s:42:"Label the bromines as axial or equatorial.";i:62;s:123:"Trans tells that one substituent is above and one is below Right molecule is more stable since substituents are equatorial.";}}